BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "block_book" (
	"year"	text,
	"name"	text,
	"value"	text,
	"surveyor"	text,
	"tract_number"	text,
	"block_number"	text,
	"plat_number"	text,
	"page_title"	text
);
CREATE TABLE IF NOT EXISTS "assessors_abstracts" (
	"year"	`text`,
	"name"	`text`,
	"value"	`text`,
	"acres"	`text`,
	"original_grantee"	`text`,
	"original_date"	`text`,
	"total_acres"	`text`,
	"abstract_number"	`text`,
	"page_title"	`text`
);
CREATE TABLE IF NOT EXISTS "censuses" (
	"line_number"	TEXT,
	"house_number"	TEXT,
	"street_name"	TEXT,
	"last_name"	TEXT,
	"given_name"	TEXT,
	"relation"	TEXT,
	"color_race"	TEXT,
	"sex"	TEXT,
	"age_at_last_birthday"	TEXT,
	"occupation"	TEXT,
	"own_or_rent"	TEXT,
	"owned_free_or_mortgage"	TEXT,
	"house_or_farm"	TEXT,
	"my_notes"	TEXT,
	"file_name"	TEXT,
	"census_year"	TEXT
);
COMMIT;
